math.randomseed(os.time())
local function GetRandName(sex)
    if not sex then sex = 2 end
    local name = nil
    if sex == 1 then
        name = namelist.male
    else
        name = namelist.female
    end
    local res = ''
    for i = 1, 10 do
        local fi = math.random(#name.firstname)
        local li = math.random(#name.lastname)
        local mi = math.random(#namelist.mark)
        -- if math.random(100) > 37 then
            -- res = name.firstname[fi] .. namelist.mark[mi] ..  name.lastname[li]
        -- else
            -- res = name.firstname[fi] ..  name.lastname[li]
        -- end
		res = name.firstname[fi] .. namelist.mark[mi] ..  name.lastname[li]
        if not his[res] then
            his[res] = true
            return res
        end
    end
    return res
end


